const theForLoop = () => {

    const moods = ['Ecstatic','Happy','meh','Upset'];

    for(let i = 0; i < moods.length; i++){
        console.log("I am: ", moods[i]);
    }

}

const theForEachLoop = () => {

    const moods = [
        {
            description: 'Ecstatic',
            currentFeeling: false
        },
        {
            description: 'Happy',
            currentFeeling: true
        },
        {
            description: 'meh',
            currentFeeling: false
        },
        {
            description: 'Upset',
            currentFeeling: false
        },
    ];

    moods.forEach(mood => {
        const string = "Right now, I am "; 

        if(mood.currentFeeling) {
            return console.log(string + mood.description);
        }
    })

}

const theMapHelper = () => {
    const teams = [
        {
            name: 'Manchester United',
            coach: 'Ole Gunnar Soklsjear',
            country: 'England',
            wins: 5,
            losses: 2,
            draws: 1
        },
        {
            name: 'Bayern Munich',
            coach: 'Julian Nagelsmann',
            country: 'Germany',
            wins: 6,
            losses: 1,
            draws: 1
        },
        {
            name: 'Orlando City',
            coach: 'Óscar Pareja',
            country: 'United States of America',
            wins: 4,
            losses: 2,
            draws: 2
        },
    ]

    const matchWinners = teams.map(team => {
        team.wins += 1;
        return team;
    });


    console.log({teams});
    console.log({matchWinners});
}

const theFilterHelper = () => {
    const teams = [
        {
            name: 'Manchester United',
            coach: 'Ole Gunnar Soklsjear',
            country: 'England',
            wins: 5,
            losses: 2,
            draws: 1
        },
        {
            name: 'Bayern Munich',
            coach: 'Julian Nagelsmann',
            country: 'Germany',
            wins: 6,
            losses: 1,
            draws: 1
        },
        {
            name: 'Orlando City',
            coach: 'Óscar Pareja',
            country: 'United States of America',
            wins: 4,
            losses: 2,
            draws: 2
        },
    ]

    const notUSATeams = teams.filter(team => team.country !== 'United States of America');


    console.log({teams});
    console.log({notUSATeams});
}

